import React from 'react'
import { Link, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const Landing = ({isAuthenticated}) => {
  // as we dont want to see the landing page when we click the devconnector in dashboard page
  if (isAuthenticated) {
    return <Redirect to='/dashboard'/>;
  }
    return (
        <section className="landing">
          <div className="dark-overlay">
            <div className="landing-inner">
             <h1 className="x-large">QA Connector</h1>
              <p className="lead">
                Create an account to connect Mahi's profile/portfolio website, we can connect here to discuss.
              </p>
            <div className="buttons">
              <Link to="/register" className="btn btn-primary">
                Sign Up
              </Link>
              <Link to="/login" className="btn btn-light">
                Login
              </Link>
            </div>
          </div>
        </div>
      </section>
    );
};
Landing.propTypes  ={
  isAuthenticated: PropTypes.bool
}

const mapStateToProps = state => ({
  isAuthenticated : state.auth.isAuthenticated
});
export default connect(mapStateToProps) (Landing);
